import { NgModule } from '@angular/core';
import { Routes, RouterModule } from '@angular/router';

import { ConsultationModifPage } from './consultation-modif.page';

const routes: Routes = [
  {
    path: '',
    component: ConsultationModifPage
  }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule],
})
export class ConsultationModifPageRoutingModule {}
